7667e19f-6db2-42b6-a5c3-bb66dcc4de46	ed6702c2-9078-4b74-b120-d912429b1562	2	<p>Jelaskan perbedaan antara perangkat keras (hardware) dan perangkat lunak (software) dalam sistem komputer, serta berikan contoh masing-masing!</p>	1	2024-11-11 16:27:00.729476	2024-11-14 00:32:56.955291	\N	f	t	{"REF_ESAY":"\\u003cp\\u003e\\u003cstrong\\u003ePerangkat Keras (Hardware):\\u003c/strong\\u003e\\u003cbr\\u003ePerangkat keras adalah komponen fisik yang ada dalam sistem komputer yang berfungsi untuk menjalankan dan mendukung sistem komputer. Perangkat keras ini meliputi CPU (Central Processing Unit), RAM (Random Access Memory), hard disk, motherboard, keyboard, monitor, dan perangkat lainnya yang dapat dilihat dan disentuh.\\u003cbr\\u003e\\u003cstrong\\u003eContoh perangkat keras:\\u003c/strong\\u003e\\u003c/p\\u003e\\u003cp\\u003eCPU (Central Processing Unit)\\u003c/p\\u003e\\u003cp\\u003eRAM (Random Access Memory)\\u003c/p\\u003e\\u003cp\\u003eHard disk\\u003c/p\\u003e\\u003cp\\u003eMonitor\\u003c/p\\u003e\\u003cp\\u003eKeyboard\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003ePerangkat Lunak (Software):\\u003c/strong\\u003e\\u003cbr\\u003ePerangkat lunak adalah program atau aplikasi yang berjalan di atas perangkat keras untuk mengatur dan memproses data. Software tidak memiliki bentuk fisik dan berfungsi untuk memberi instruksi pada perangkat keras agar dapat bekerja sesuai dengan kebutuhan pengguna.\\u003cbr\\u003e\\u003cstrong\\u003eContoh perangkat lunak:\\u003c/strong\\u003e\\u003c/p\\u003e\\u003cp\\u003eSistem Operasi (misalnya Windows, Linux, macOS)\\u003c/p\\u003e\\u003cp\\u003eAplikasi perkantoran (misalnya Microsoft Word, Excel)\\u003c/p\\u003e\\u003cp\\u003ePerangkat lunak pengolah grafis (misalnya Adobe Photoshop)\\u003c/p\\u003e\\u003cp\\u003ePerangkat lunak pengelola basis data (misalnya MySQL)\\u003c/p\\u003e"}	0
a0cf370e-3e0f-43ff-a698-c1e89efa17a6	ed6702c2-9078-4b74-b120-d912429b1562	2	<p>Apa yang dimaksud dengan sistem operasi dalam konteks sistem komputer? Jelaskan berbagai fungsi penting yang dilakukan oleh sistem operasi pada sebuah komputer.</p>	1	2024-11-11 16:27:00.730627	2024-11-14 00:33:52.092408	\N	f	t	{"REF_ESAY":"\\u003cp\\u003eSistem operasi (OS) adalah perangkat lunak yang mengelola perangkat keras dan perangkat lunak lainnya dalam komputer. Fungsi utama sistem operasi adalah untuk memfasilitasi interaksi antara pengguna dan perangkat keras, serta mengatur alur eksekusi program. Berikut adalah beberapa fungsi penting dari sistem operasi:\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eManajemen Proses:\\u003c/strong\\u003e\\u003cbr\\u003eSistem operasi mengelola proses yang berjalan di dalam komputer, termasuk mengalokasikan waktu CPU untuk setiap proses yang aktif dan mengelola komunikasi antar proses.\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eManajemen Memori:\\u003c/strong\\u003e\\u003cbr\\u003eOS mengelola memori utama (RAM), mengalokasikan ruang memori untuk proses yang berjalan, dan memastikan bahwa data dan program tidak bertabrakan di dalam memori.\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eManajemen Perangkat Keras (Hardware):\\u003c/strong\\u003e\\u003cbr\\u003eSistem operasi bertugas untuk mengelola perangkat keras komputer (seperti hard disk, printer, keyboard, dll.) dan memberikan antarmuka antara perangkat keras dan perangkat lunak. Hal ini dilakukan melalui \\u003cstrong\\u003edriver\\u003c/strong\\u003e perangkat keras.\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eManajemen File:\\u003c/strong\\u003e\\u003cbr\\u003eOS mengelola penyimpanan data dalam bentuk file, termasuk menyediakan cara untuk menyimpan, mengakses, memodifikasi, dan menghapus file. OS juga mengatur sistem direktori.\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eKeamanan dan Akses Kontrol:\\u003c/strong\\u003e\\u003cbr\\u003eSistem operasi menjaga kea