c1bc3189-de8d-408d-9b4f-f46bc6d7dcf8	ed6702c2-9078-4b74-b120-d912429b1562	2	<p><strong>Perangkat keras komputer terdiri dari berbagai komponen. Sebutkan dan jelaskan fungsi dari lima komponen perangkat keras utama dalam komputer, seperti CPU, RAM, motherboard, hard disk, dan kartu grafis.</strong></p>	1	2024-11-11 16:27:00.731872	2024-11-14 00:34:18.769605	\N	f	t	{"REF_ESAY":"\\u003cp\\u003e\\u003cstrong\\u003eCPU (Central Processing Unit):\\u003c/strong\\u003e\\u003cbr\\u003eCPU adalah komponen utama yang bertanggung jawab untuk menjalankan instruksi-instruksi dari program komputer. CPU terdiri dari dua bagian utama: \\u003cstrong\\u003eControl Unit (CU)\\u003c/strong\\u003e dan \\u003cstrong\\u003eArithmetic Logic Unit (ALU)\\u003c/strong\\u003e. CU mengontrol alur data dan instruksi, sementara ALU melakukan operasi aritmatika dan logika.\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eRAM (Random Access Memory):\\u003c/strong\\u003e\\u003cbr\\u003eRAM adalah memori sementara yang digunakan untuk menyimpan data dan program yang sedang dijalankan. Semakin besar kapasitas RAM, semakin banyak aplikasi atau data yang dapat dijalankan secara bersamaan tanpa memperlambat kinerja komputer.\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eMotherboard:\\u003c/strong\\u003e\\u003cbr\\u003eMotherboard adalah papan sirkuit utama dalam komputer yang menghubungkan semua komponen perangkat keras seperti CPU, RAM, hard disk, kartu grafis, dan perangkat lainnya. Motherboard juga menyediakan jalur komunikasi antara komponen-komponen tersebut.\\u003c/p\\u003e\\u003cp\\u003e\\u003cstrong\\u003eHard Disk (HDD atau SSD):\\u003c/strong\\u003e\\u003cbr\\u003eHard disk adalah perangkat penyimpanan permanen yang digunakan untuk menyimpan data, program, dan sistem operasi. Hard disk terdiri dari dua jenis: \\u003cstrong\\u003eHDD (Hard Disk Drive)\\u003c/strong\\u003e yang menggunakan piringan magnetik, dan \\u003cstrong\\u003eSSD (Solid State Drive)\\u003c/strong\\u003e yang lebih cepat